import React from 'react';
import './Navbar.css';
import {Link} from 'react-router-dom';

/* <Link to='/profile'>
                    <li>Profile</li>
                </Link>
                */
 function Navbar(){
    return (
        <div className='navbar'>
            <ul className='links'>
                <Link to='/'>
                    <li>Home</li>
                </Link>
                <Link to='/login'>
                    <li>Log In</li>
                </Link>
                <Link to='/signup'>
                    <li>Sign Up</li>
                </Link>
            </ul>
        </div>
    )
}

export default Navbar;
